import './App.css';

import { BrowserRouter, Route, Routes } from "react-router-dom";

import { Articulos } from './components/Item';
import { CartContainer } from './components/Cart/CartContainter';
import { CartProvider } from './components/Context/CartContext';
import { Home } from './components/Home/Home';
import { ItemDetailContainer } from './components/ItemDetailContainer.jsx';
import { ItemListContainer } from './components/ItemListContainer.jsx';
import { Nav } from './components/Nav/Nav.jsx';
import { React } from 'react';

function App() {


  return (

    Articulos.map(producto => {

      <BrowserRouter className="App" >
         <CartProvider>
        <Nav productoProp={producto}/>
        <Routes>

          <Route path="/" element={<Home />} />
          <Route path="/category" element={<ItemListContainer />} className="cardPadre" />
          <Route path="/category/:plantas" element={<ItemListContainer />} className="cardPadre" />
          <Route path="/category/:macetas" element={<ItemListContainer />} className="cardPadre" />
          <Route path="/item/:id" element={<ItemDetailContainer />} className="cardPadre" />
          <Route path="/cart" element={<CartContainer />} />

        </Routes>
        </CartProvider>
      </BrowserRouter>

    })

  );

}



export default App;
